    await RdbUtils.createDb();

    RdbUtils.createTable(CommonConstants.TASK_INFO.tableName ? CommonConstants.TASK_INFO.tableName : '', columnTaskInfoInfoList).then(() => {
    }).catch((err: Error) => {
    });  }

